import React from 'react'
import Img1 from "../../assets/images/phone-g-call.svg";
import Img2 from "../../assets/images/certificate-r.svg";
import Img3 from "../../assets/images/scissors.svg";
import Img4 from "../../assets/images/devices.svg";
import Img5 from "../../assets/images/certificate.svg";
import styled from 'styled-components';
export default function SchoolTefun() {
  return (
        <SectionContainer>
            <WrapperContainer>
                <Heading>സ്കൂളുകൾക്ക്  <Sm>Tefun</Sm>പ്രോഗ്രാമിന്റെ ഭാഗമാകാം</Heading>
                <Details>
                    <Card>
                        <Count></Count>
                        <DetailContainer>
                            <ImageContainer>
                                <Img src={Img1} alt="Image"/>
                            </ImageContainer>
                        </DetailContainer>
                        <Discription><Bold>Tefun</Bold>പ്രോഗ്രാമിന്റെ ഭാഗമാകാൻ ആഗ്രഹിക്കുന്ന സ്കൂളുകൾക്ക് <Bold>Talrop</Bold>-ന്റെ ടീമുമായി <Number>858 999 8744</Number> എന്ന നമ്പറിൽ കോൺടാക്ട് ചെയ്യാവുന്നതാണ്.</Discription>
                    </Card>
                    <Card>
                        <Count></Count>
                        <DetailContainer>
                            <ImageContainer>
                                <Img src={Img2} alt="Image"/>
                            </ImageContainer>
                        </DetailContainer>
                        <Discription>സ്കൂളിന്റെ ലോഗോയും അവശ്യ വിവരങ്ങളും നൽകുക.</Discription>
                    </Card>
                    <Card>
                        <Count></Count>
                        <DetailContainer>
                            <ImageContainer>
                                <Img src={Img3} alt="Image"/>
                            </ImageContainer>
                        </DetailContainer>
                        <Discription>സ്കൂൾ നിശ്ചയിക്കുന്ന ഉദ്ഘാടന ദിനത്തിൽ ആവശ്യമായ<I>Inauguration Video</I> ഡിജിറ്റലായി<Bold>Talrop</Bold>നൽകുന്നതാണ്.</Discription>
                    </Card>
                    <Card>
                        <Count></Count>
                        <DetailContainer>
                            <ImageContainer>
                                <Img src={Img4} alt="Image"/>
                            </ImageContainer>
                        </DetailContainer>
                        <Discription><I>Mobile, Tab, Laptop, Desktop Computer</I>എന്നിവയിൽ ഏതെങ്കിലും ഡിവൈസുകൾ ഉപയോഗിച്ച്  <I>Talrop</I>ലഭ്യമാക്കുന്ന <I>Web,Android, iOS</I> പ്ലാറ്റ്ഫോമുകളിലൂടെ കുട്ടികൾക്ക് പഠിക്കുവാൻ സാധിക്കും.</Discription>
                    </Card>
                    <Card>
                        <Count></Count>
                        <DetailContainer>
                            <ImageContainer>
                                <Img src={Img5} alt="Image"/>
                            </ImageContainer>
                        </DetailContainer>
                        <Discription>വിജയകരമായി പൂർത്തീകരിക്കുന്ന വിദ്യാർത്ഥികൾക്ക് ടാൽറോപ് സർട്ടിഫിക്കറ്റ് നൽകുന്നു.</Discription>
                    </Card>
                </Details>
                <JoinButton>Join for free</JoinButton>
            </WrapperContainer>
        </SectionContainer>
  )
}

const SectionContainer = styled.section``;
const WrapperContainer = styled.section``;
const Heading = styled.h4``;
const Sm = styled.span``;
const Details = styled.ul``;
const Card = styled.li``;
const Count = styled.div``;
const DetailContainer = styled.div``;
const ImageContainer = styled.div``;
const Img = styled.img``;
const Discription = styled.h4``;
const Bold = styled.span``;
const I = styled.span``;
const Number = styled.span``;
const JoinButton = styled.bu
